import GoToTop from '../GoToTop'

function Products() {
  return (
    <>
      <Header Banner={"./Banner/AboutBanner.jpeg"} text={"About Us"} lightText={true} />

      <div>Products</div>

      <GoToTop />
     </>

  )
}

export default Products
